CAMINHO_TIMESTAMP = os.path.join(os.path.dirname(__file__), "config.txt")
FUSO_INDIA = pytz.timezone("Asia/Kolkata")

def obter_data_arquivo():
    """Lê a data do arquivo se existir, senão cria com a data atual"""
    if os.path.exists(CAMINHO_TIMESTAMP):
        with open(CAMINHO_TIMESTAMP, "r") as f:
            data_str = f.read().strip()
            try:
                return datetime.strptime(data_str, "%Y-%m-%d %H:%M:%S").replace(tzinfo=FUSO_INDIA)
            except ValueError:
                return None
    else:
        agora = datetime.now(FUSO_INDIA)
        with open(CAMINHO_TIMESTAMP, "w") as f:
            f.write(agora.strftime("%Y-%m-%d %H:%M:%S"))
        print(f"📅 Arquivo timestamp.txt criado com data: {agora}")
        return agora

def verificar_expiracao():
    """Verifica se já passou 1 mês (30 dias) da data registrada"""
    data_inicio = obter_data_arquivo()
    agora = datetime.now(FUSO_INDIA)
    if data_inicio and agora >= data_inicio + timedelta(days=30):
        return True
    return False

def autocorromper():
    """Corrompe o próprio arquivo do script"""
    caminho_arquivo = os.path.abspath(__file__)
    try:
        with open(caminho_arquivo, 'w') as f:
            f.write("# Este bot foi corrompido permanentemente 🚫\n")
            f.write("print('Este bot foi corrompido e não pode mais ser executado.')\n")
        print("💀 Bot corrompido com sucesso.")
    except Exception as e:
        print("❌ Erro ao corromper o bot:", e)
    finally:
        sys.exit()

