# ✅ FUNÇÃO PARA CHECAR AS NOTÍCIAS NO FOREXFACTORY APENAS NOS ATIVOS RELEVANTES PARA O PAR ESCOLHIDO
def parse_hora_noticia(hora_noticia_str):
    """
    Converte a string de hora de notícia em um objeto datetime. 
    Trata eventos 'All Day' retornando None.
    """
    # Verifica se é um evento 'All Day'
    if hora_noticia_str == "All Day":
        return None  # Ou você pode retornar um horário simbólico como o início do dia, se preferir

    # Adiciona espaço entre a hora e AM/PM, se necessário
    hora_noticia_str = hora_noticia_str.replace("AM", " AM").replace("PM", " PM")
    
    # Tenta converter o horário a partir dos formatos fornecidos
    formatos = ["%I:%M %p", "%H:%M"]
    for formato in formatos:
        try:
            return datetime.strptime(hora_noticia_str, formato)
        except ValueError:
            continue

    # Se o formato não for válido, levanta uma exceção
    raise ValueError(f"Formato de hora inválido: {hora_noticia_str}")

