# ✅ FUNÇÃO PARA CHECAR AS NOTÍCIAS NO FOREXFACTORY APENAS NOS ATIVOS RELEVANTES PARA O PAR ESCOLHIDO
def checa_noticias_forex(par_moedas):
    global Ativo
    Ativo = par_moedas
    now = datetime.now()
    minutos_antes = timedelta(minutes=15)
    minutos_depois = timedelta(minutes=15)

    ativo1, ativo2 = par_moedas[:3], par_moedas[3:]
    ativos_monitorados = [ativo1, ativo2, "EUR", "USD"]

    if lista_noticias_forex:
        noticias_a_remover = []  # Lista para limpar notícias fora do intervalo

        for noticia in lista_noticias_forex:
            data_noticia, hora_noticia_str, touros, ativo = noticia

            if ativo not in ativos_monitorados:
                continue  # Ignora ativos não relevantes

            if hora_noticia_str == "All Day" and touros >= 3:
                print(f"Notícia de dia inteiro bloqueando: {ativo}")
                return False, ativo, "All Day"

            try:
                # Converte a string de horário em um objeto datetime
                hora_noticia = datetime.strptime(hora_noticia_str, '%I:%M%p').time()
                hora_noticia_dt = datetime.combine(now.date(), hora_noticia)

                # Verifica se a notícia está dentro da janela de tempo considerada
                if hora_noticia_dt - minutos_antes <= now and hora_noticia_dt + minutos_depois >= now:
                    if touros >= 2:
                        print(f"Notícia relevante encontrada: {ativo} às {hora_noticia_dt.strftime('%H:%M')}")
                        return False, ativo, hora_noticia_dt.strftime("%H:%M")
                elif hora_noticia_dt + minutos_depois < now:
                    # Marca para remoção apenas se a notícia já passou completamente do intervalo
                    noticias_a_remover.append(noticia)
            except ValueError as e:
                print(f"Erro ao processar hora: {e}")

        # Remove as notícias fora do intervalo
        for noticia in noticias_a_remover:
            lista_noticias_forex.remove(noticia)

    return True, None, None

