# GERENCIAMENTO MASANIELLO  MDG DELTA
#############################################################################################
class MDG__MASANIELLO:
    def __init__(self, quantidade, vitorias, banca):
        self.quantidade = int(quantidade)
        self.vitorias = int(vitorias)
        self.pay = float(1.86) # payout 86%
        self.type = "normal"  # Normal ou Progressivo
        self.banca = float(banca) # Usa o saldo real ao inicializar
        self.banca_final = float(banca)
        self.qnt_wins = 0
        self.qnt_loss = 0
        self.last_entry = 0
        self.first_entry = True
        self.results_df = pd.DataFrame(columns=["Nº OPTIONS", "WIN/LOSS", "INVESTMENTS", "RETURNS", "FINAL BALANCE"])
        self.table = pd.DataFrame(index=range(self.quantidade), columns=range(self.vitorias + 1))

        # Populate the decision table
        for row in range(self.quantidade - 1, -1, -1):
            for col in range(self.vitorias, -1, -1):
                if col > self.vitorias:
                    self.table.loc[row, col] = float('NaN')
                elif col == self.vitorias:
                    self.table.loc[row, col] = 1
                elif self.vitorias - col == self.quantidade - row:
                    self.table.loc[row, col] = pow(self.pay, self.quantidade - row)
                else:
                    if row < self.quantidade - 1:
                        cell_value_below = self.table.loc[row + 1, col]
                    elif col == self.vitorias - 1:
                        cell_value_below = 1
                    else:
                        cell_value_below = float('NaN')

                    if col < self.vitorias - 1 and row < self.quantidade - 1:
                        cell_value_side = self.table.loc[row + 1, col + 1]
                    elif col == self.vitorias - 1:
                        cell_value_side = 1
                    else:
                        cell_value_side = float('NaN')

                    if cell_value_below == float('NaN') and cell_value_side == float('NaN'):
                        self.table.loc[row, col] = float('NaN')
                    else:
                        self.table.loc[row, col] = (float(self.pay) * float(cell_value_below) * float(cell_value_side) /
                                                      (float(cell_value_below) + float(self.pay - 1) * float(cell_value_side)))

    def calculate_first_entry(self):
        try:
            if self.table.shape[0] > 1 and self.table.shape[1] > 1:
                cell_value_2x2 = self.table.loc[1, 1]
                cell_value_1x2 = self.table.loc[1, 0]
                if pd.isna(cell_value_2x2) or pd.isna(cell_value_1x2):
                    return 0
                self.last_entry = round((1 - self.pay * cell_value_2x2 / (cell_value_1x2 + (self.pay - 1) * cell_value_2x2)) * self.banca, 2)
                return self.last_entry
            else:
                return 0
        except Exception as e:
            return 0

    def calcula_entrada(self, result=None):
        try:
            # Verificar condições de parada antes de qualquer cálculo
            if self.qnt_wins >= self.vitorias:
                self.last_entry = 0
                return 0  # Retorna 0 para indicar que não haverá mais entradas

            if (self.qnt_wins + self.qnt_loss) >= self.quantidade:
                self.last_entry = 0
                return 0  # Retorna 0 para indicar que não haverá mais entradas


            if self.first_entry:
                self.last_entry = self.calculate_first_entry()
                self.first_entry = False
                return self.last_entry
            
            # Se foi empate, mantém a última entrada
            if result == 'empate':
                self.empate = True  # Flag de empate ativada
                return self.last_entry

            # Resetar a flag de empate se não for empate
            self.empate = False
            
            if result == 'win':
                profit_loss = self.last_entry * (self.pay - 1)
                self.banca_final += profit_loss
                self.qnt_wins += 1
                new_row = pd.DataFrame({
                    "Nº OPTIONS": [len(self.results_df) + 1],
                    "WIN/LOSS": ["W"],
                    "INVESTMENTS": [f"$ {self.last_entry:.2f}"],
                    "RETORNOS": [f"$ {profit_loss:.2f}"],
                    "SALDO FINAL": [f"$ {self.banca_final:.2f}"]
                })
                self.results_df = pd.concat([self.results_df, new_row], ignore_index=True)

            if result == 'loss':
                profit_loss = self.last_entry
                self.banca_final -= profit_loss
                self.qnt_loss += 1
                new_row = pd.DataFrame({
                    "Nº OPTIONS": [len(self.results_df) + 1],
                    "WIN/LOSS": ["L"],
                    "INVESTMENTS": [f"$ {self.last_entry:.2f}"],
                    "RETORNOS": [f" - $ {profit_loss:.2f}"],
                    "FINAL BALANCE": [f"$ {self.banca_final:.2f}"]
                })
                self.results_df = pd.concat([self.results_df, new_row], ignore_index=True)

            if self.qnt_wins >= self.vitorias:
                self.last_entry = 0
                return self.last_entry

            row_index = self.qnt_loss + self.qnt_wins + 1
            col_index = self.qnt_wins + 1
            
            if row_index < self.table.shape[0] and col_index < self.table.shape[1]:
                cell_value_2x2 = self.table.loc[row_index, col_index]
                cell_value_1x2 = self.table.loc[row_index, col_index - 1]

                if pd.isna(cell_value_2x2) or pd.isna(cell_value_1x2):
                    self.last_entry = self.banca_final  # Default to remaining bankroll
                    return self.last_entry

                self.last_entry = round((1 - self.pay * cell_value_2x2 / (cell_value_1x2 + (self.pay - 1) * cell_value_2x2)) * self.banca_final, 2)
                return self.last_entry
            
            self.last_entry = self.banca_final  # Default to remaining bankroll
            return self.last_entry

        except Exception as e:
            self.last_entry = self.banca_final
            return self.last_entry
        
    def display_results(self, log_window):
        try:
            formatted_results = self.results_df.to_string(index=False)
            log_window.insert(tk.END, f"{formatted_results}\n", "gold")
            log_window.insert('end',f'♦════♦♦════♦♦════♦♦════♦♦════♦MASANIELLO♦════♦♦════♦♦════♦♦════♦\n',"gold")
            log_window.see(tk.END)
        except Exception as e:
            log_window.insert(tk.END, f"Erro ao exibir resultados: {e}\n", "red")

