# ✅ GERENCIAMENTO DELTA INFINIT  
def DELTA_INFINIT(
    log_window, valor_inicial, lucro_op, resultado, 
    entrada_atual, lucro_acumulado, lucro_total, stop_loss,
    stop_win, banca_final, valor_entrada, results_df=None
):
    global qnt_loss

    # Inicializar o DataFrame se não for passado
    if results_df is None:
        results_df = pd.DataFrame(columns=["Nº OPTIONS", "WIN/LOSS", "INVESTMENTS", "RETURNS", "FINAL BALANCE"])
    
    try:

        if log_window is not None:
            log_window.tag_configure("blue", foreground="blue")
            log_window.tag_configure("green", foreground="green")
            log_window.tag_configure("red", foreground="red")
        # 🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹
        # ⚠️ Capturar o valor de entrada ANTES de ajustes para registrar o valor correto
        investimento_real = valor_entrada
        # 🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹
        # Se o resultado for positivo (WIN)
        if resultado is not None and resultado > 0:
            qnt_loss = 0
            banca_final += resultado  # Atualiza o saldo final
            lucro_acumulado += lucro_op
            if entrada_atual == 1:  # Segunda entrada
                valor_entrada = valor_inicial # Usa o lucro da primeira entrada
                entrada_atual = 2
            else:  # Após a terceira vitória, reinicia o ciclo
                entrada_atual = 1
                lucro_acumulado = 0  # Zera o lucro acumulado
                valor_entrada = valor_inicial  # Volta para o valor inicial

            #🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹
            # Criar nova linha do DataFrame para WIN
            new_row = pd.DataFrame({
                "Nº OPTIONS": [len(results_df) + 1],
                "WIN/LOSS": ["W"],
                "INVESTMENTS": [f"$ {investimento_real:.2f}"],  # Usar o valor de investimento correto
                "RETURNS": [f"$ {resultado:.2f}"],
                "FINAL BALANCE": [f"$ {banca_final:.2f}"]

            })
 
            results_df = pd.concat([results_df, new_row], ignore_index=True)

            # Verificar Stop Win e Stop Loss
            if lucro_total >= stop_win:
                log_window.insert(tk.END, "🎯 STOP WIN\n", "green")
                PLANILHA_DELTA_INFINIT(log_window, results_df)
                sys.exit()

        # 🔹🔹🔹🔹🔹🔹🔹🔹🔹
        # Caso contrário, é LOSS
        elif resultado is not None and resultado < 0:
            qnt_loss += 1
            banca_final += resultado  # Atualiza o saldo final
            entrada_atual = 1  
            lucro_acumulado = 0  
            valor_entrada = valor_inicial

            # 🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹🔹
            # Criar nova linha do DataFrame para LOSS
            new_row = pd.DataFrame({
                "Nº OPTIONS": [len(results_df) + 1],
                "WIN/LOSS": ["L"],
                "INVESTMENTS": [f"$ {investimento_real:.2f}"],  # Usar o valor de investimento correto
                "RETURNS": [f"$ {resultado:.2f}"],
                "FINAL BALANCE": [f"$ {banca_final:.2f}"]
            })
      
            results_df = pd.concat([results_df, new_row], ignore_index=True)

            if qnt_loss >= stop_loss:
                log_window.insert(tk.END, "🛑 STOP LOSS\n", "red")
                PLANILHA_DELTA_INFINIT(log_window, results_df)
                sys.exit()


        return valor_entrada, entrada_atual, lucro_acumulado, qnt_loss, banca_final, results_df

    except Exception as e:
        print(f"Erro no DELTA_INFINIT: {e}")
        return None, None, None, None, None, None

