            info_ativo = ativos_payout.get(ativo_atual)
            if not info_ativo or not info_ativo.get("open") or info_ativo.get("turbo", 0) < payout_minimo:
                return await ESCOLHER_ATIVO(QX_MDG, payout_minimo, timeout, vol_min, min_velas_com_pavio)

