    log_window.tag_configure("white", foreground="white")
    log_window.tag_configure("blue", foreground="blue")
    log_window.tag_configure("red", foreground="red")
    log_window.tag_configure("orange", foreground="orange")
    log_window.tag_configure("gold", foreground="gold")
    ######################################################################
    try:
        gerenciamento = app.gerenciamento
    except AttributeError:
        print("❌ Gerenciamento ainda não foi definido!")
        return
    
    if not isinstance(gerenciamento, MDG__MASANIELLO) and not callable(DELTA_INFINIT):
        log_window.insert(tk.END, "Gerenciamento não foi inicializado corretamente.\n", "red")
        return

    # Inicializa variáveis de controle
    valor_entrada = valor_inicial
    entrada_atual = 1
    lucro_acumulado = 0
    qnt_loss = 0
    lucro_total = 0
    timeframe = 1
    results_df = pd.DataFrame(columns=["Nº OPTIONS", "WIN/LOSS", "INVESTMENTS", "RETURNS", "FINAL BALANCE"])
    inicio_tempo = time.time()
    ultimo_minuto = None
    candles = QX_MDG.start_candles_stream(par_moedas, 1)
    ativo_anterior = par_moedas  # 🔹 Armazena o ativo inicial
    await aguardar_proximo_minuto() 

    # Tente obter as velas em tempo real diretamente
    while True:

        if verificar_expiracao():
            print("⛔ Tempo de uso expirado.")
            autocorromper()

        try:
            agora = datetime.now()
            tempo_atual = time.time()
            tempo_passado = tempo_atual - inicio_tempo

            if tempo_passado >= 120:
                while True:
                    novo_ativo, payout, novo_limiar = await MONITORAR_ATIVO(
                        QX_MDG, par_moedas, payout_atual
                    )

                    if novo_ativo:
                        ativo_foi_alterado = novo_ativo != par_moedas
                        par_moedas = novo_ativo
                        payout_atual = payout
                        limiar = novo_limiar
                        candles = QX_MDG.start_candles_stream(par_moedas, 1)

                        if ativo_foi_alterado:
                            await aguardar_proximo_minuto()
                            ativo_anterior = par_moedas  # Atualiza o ativo anterior
                        break

                    await asyncio.sleep(5)

                inicio_tempo = time.time()

            # 🎯 Lógica principal de entrada
            agora = datetime.now()
            minuto_atual = agora.minute

            if minuto_atual != ultimo_minuto:
                ultimo_minuto = minuto_atual
                ordem_aberta = False

            # Obter velas e preço atual
            velas = await QX_MDG.get_candles(par_moedas, 60, 100, time.time())
            # Listas para armazenar máximas e mínimas das velas anteriores
            ABERTURA_VENDEDORA = []
            ABERTURA_COMPRADORA = []

            # Iterar sobre as velas para capturar máximas e mínimas anteriores
            for i in range(1, len(velas)):
                vela = velas[i]  # Vela atual
                vela_anterior = velas[i - 1]  # Vela anterior
                maxima = vela_anterior["max"]
                minima = vela_anterior["min"]

                # Calcular a diferença de tempo entre as velas
                diff_timestamp = vela["from"] - vela_anterior["from"]
                corpo = (vela_anterior["open"] - vela_anterior["close"])

                # Verificar se a diferença de tempo é aproximadamente 60 segundos
                if abs(diff_timestamp - 60) <= 0.5:
                    if corpo >= 0.02800:
                        if vela_anterior["open"] > vela_anterior["close"]: 
                            ABERTURA_VENDEDORA.append(vela_anterior["max"])
                            ABERTURA_VENDEDORA.append(vela_anterior["open"])

                        elif vela_anterior["open"] < vela_anterior["close"]: 
                            ABERTURA_COMPRADORA.append(vela_anterior["open"])
                            ABERTURA_COMPRADORA.append(vela_anterior["min"])


            ticks = await QX_MDG.get_realtime_price(par_moedas)

            if not ticks:
                await asyncio.sleep(0.1)
                continue

            preco_abertura = velas[-1]["open"]
            preco_atual = ticks[-1]['price']
            segundos = datetime.now().second

            if 0 <= segundos <= 28 and not ordem_aberta:
                direcao = None
                if preco_abertura > preco_atual:
                    for ABERTURA in ABERTURA_COMPRADORA:
                        if ABERTURA < preco_abertura and preco_atual <= ABERTURA:
                            direcao = "call"
                            break  # Encontrou nível válido, pode parar


                elif preco_abertura < preco_atual:
                    for ABERTURA in ABERTURA_VENDEDORA:
                        if ABERTURA > preco_abertura and preco_atual >= ABERTURA:
                            direcao = "put"
                            break  # Encontrou nível válido, pode parar
                
                else:
                    continue

                if direcao:
                    try:
                        resultado, lucro_op, lucro_total = await POSICIONAR_QUOTEX(
                            log_window, par_moedas, banca_final, valor_inicial, valor_entrada,
                            stop_win, stop_loss, direcao, payout_atual, stop_event, quem_fechou, timeframe
                        )

                        if resultado is None:
                            ordem_aberta = False
                            continue

                        if isinstance(gerenciamento, MDG__MASANIELLO):
                            # ✅ GESTÃO MASSANIELLO
                            if isinstance(resultado, (int, float)):
                                if resultado > 0:
                                    gerenciamento.calcula_entrada("win")
                                elif resultado < 0:
                                    gerenciamento.calcula_entrada("loss")
                                else:
                                    gerenciamento.calcula_entrada("empate")
                            else:
                                log_window.insert(tk.END, f"Ordem negada pela corretora: {resultado}\n", "red")

                            # Exibe a planilha a cada entrada (ou com base em algum critério)
                            if gerenciamento.qnt_wins >= gerenciamento.vitorias or (gerenciamento.qnt_wins + gerenciamento.qnt_loss) >=     gerenciamento.quantidade:
                                log_window.insert(
                                'end',
                                    f'♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦♦════♦\n',
                                    "gold"
                                )
                                gerenciamento.display_results(log_window)
                                stop_event.set()
                                break  # agora sim encerra de fato


                        elif callable(DELTA_INFINIT):  # ✅ GESTÃO INFINIT
                            valores = DELTA_INFINIT(
                                log_window, valor_inicial, lucro_op, resultado,
                                entrada_atual, lucro_acumulado, lucro_total, stop_loss,
                                stop_win, banca_final, valor_entrada, results_df
                            )

                            if isinstance(valores, tuple) and len(valores) == 6:
                                valor_entrada, entrada_atual, lucro_acumulado, qnt_loss, banca_final, results_df = valores
                            else:
                                log_window.insert(tk.END, "⚠️ Erro ao processar DELTA_INFINIT.\n", "red")
                                ordem_aberta = False
                                continue

                        ordem_aberta = True

                    except Exception as e:
                        log_window.insert(tk.END, f"Erro ao executar a função venda: {e}\n", "red")
                        
                    ordem_aberta = True 

            await asyncio.sleep(0.5)

        except KeyboardInterrupt:
            if quem_fechou is not None and quem_fechou.is_alive():
                stop_event.set()
                quem_fechou.join(timeout=2)
            break

